import React from 'react';
import { useTheme } from '../../context/ThemeContext';
import { themeContent } from '../../data/themeContent';
import ServiceCard from '../ServiceCard/ServiceCard';
import './ServiceOverview.css';

const ServiceOverview = () => {
  const { theme } = useTheme();
  const content = themeContent[theme]; // Get the specific content based on the selected theme

  return (
    <section className={`service-overview ${theme}`}>
      <h2 className={`section-title ${theme}`} data-aos="fade-up">
        Our Services
      </h2>
      <div
        className="services-grid"
        data-aos="fade-up"
        data-aos-delay="100"
      >
        {content.services.map((service, index) => (
          <ServiceCard
            key={index}
            title={service.title}
            description={service.description}
            metric={service.metric}
          />
        ))}
      </div>
    </section>
  );
};

export default ServiceOverview;
